211913/T2RONSXXleXXXXXXXX_!!850211913.jpg\" class=\"\" width=\"745\" height=\"138\" style=\"border: 0px; vertical-align: top; margin: 0px; padding: 0px;\"/><br/></td></tr><tr><td style=\"margin: 0px; padding: 0px;\"><img src=\"https://img.alicdn.com/imgextra/i3/850211913/T2GCPtXdBXXXXXXXXX_!!850211913.jpg\" class=\"\" width=\"750\" height=\"35\" style=\"border: 0px; vertical-align: top; margin: 0px; padding: 0px;\"/></td></tr><tr align=\"middle\"><td background=\"https://img.alicdn.com/imgextra/i3/850211913/T2XoYsXktXXXXXXXXX_!!850211913.jpg\" style=\"margin: 0px; padding: 0px;\"><br/><img src=\"https://img.alicdn.com/imgextra/i1/850211913/T2Wn9XXnxcXXXXXXXX_!!850211913.jpg\" class=\"\" width=\"745\" height=\"252\" style=\"border: 0px; vertical-align: top; margin: 0px; padding: 0px;\"/><br/><img src=\"https://img.alicdn.com/imgextra/i3/850211913/T2X7q_XvlaXXXXXXXX-850211913.jpg\" class=\"\" width=\"745\" height=\"726\" style=\"border: 0px; vertical-align: top; margin: 0px; padding: 0px; float: none;\"/><br/><br/></td></tr><tr><td style=\"margin: 0px; padding: 0px;\"><img src=\"https://img.alicdn.com/imgextra/i2/850211913/T2GVFCXehOXXXXXXXX_!!850211913.jpg\" class=\"\" width=\"750\" height=\"35\" style=\"border: 0px; vertical-align: top; margin: 0px; padding: 0px;\"/></td></tr><tr><td align=\"middle\" background=\"https://img.alicdn.com/imgextra/i3/850211913/T2XoYsXktXXXXXXXXX_!!850211913.jpg\" style=\"margin: 0px; padding: 0px;\"><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"95%\" style=\"border-collapse: collapse; border-spacing: 0px; text-align: left; line-height: 24px; color: rgb(102, 102, 102); font-size: 12px;\"><tbody><tr><td style=\"margin: 0px; padding: 0px;\"><span style=\"color:#870019;font-size:2px\"><strong><strong><span style=\"font-size: 13px;\"><br/>【貔貅的作用】</span></strong></strong></span><br/>貔貅是中国古代神话传说中的一种神兽，为古代五大瑞兽之一（龙、凤、龟、麒麟以及貔貅），龙头、马身、麟脚，形状似狮子，毛色灰白会飞。貔貅可招财聚宝，只进不出被称为招财神兽。<br/><br/>貔貅曾为古代两种氏族的图腾。传说帮助炎黄二帝作战有功，被赐封为“ 天禄兽 ” 即天赐福禄之意。它专为帝王守护财宝，也是皇室象征，称为 “ 帝宝 ” 。又因貔貅专食猛兽邪灵，故又称 “ 辟邪 ” 中国古代风水学者认为貔貅是转祸为祥的吉瑞之兽。&nbsp;<br/><br/>貔貅凶猛威武，它在天上负责的巡视工作，阻止妖魔鬼怪、瘟疫疾病扰乱天庭。也有一种说法它是龙的九个儿子之一。古时候人们常也用貔貅来作为军队的称呼。<br/><br/>貔貅以金银珠宝为主食，其口大，腹大，无肛门，只进不出，能吞万物而从不泻，象征揽八方之财，同时可以镇宅辟邪，专为主人聚财掌权。古贤认为命是注定的，但运程可以改变，故民间有 “ 一摸貔貅运程旺盛，再摸貔貅财运滚滚，三摸貔貅平步青云 “ 的美好祝愿。<br/><br/>貔貅开光后一生只认一个主人，貔貅唯一的嗜好，就是它很喜欢去咬钱回来讨主人欢心。若你是以求偏财为主的行业，如收入是佣金制的，奖金制的，而不是固定薪水的，那么供奉貔貅将是很好的招财法宝。它会带你去有钱的地方，同时帮你把钱咬回来。<br/><br/>貔貅习性懒懒的，喜欢睡觉，每天最好摸一摸，好像要叫醒它一样，这样财运就自然会跟着来。摸貔貅的时候切记不要摸貔貅的嘴跟鼻子。摸貔貅要摸貔貅的屁股，手做抓取状，抓完往口袋里放。象征钱财入袋！<br/><br/><strong><span style=\"color: rgb(135, 0, 25); font-size: 13px;\">【貔貅也有公母之分】</span></strong><br/>一只貔貅主招财，而两只貔貅也有公母之分 , 民间传说公的貔貅代表财运，而母的貔貅则代表财库，有财要有库才能守得住 , 因此请购貔貅大多都一次请购一对 , 才能够真正的起到招财进宝的功效。<br/><br/>双貔貅喻意招财避邪，一只公的，一只母的，公的攻财，母的守财，一攻一守，两者同时使用，效果非常神奇！回头貔貅还有升官有功效，貔貅左回头貔貅会升官，右回头貔貅财源广进，左脚在前是公貔貅，,右脚在前是母貔貅，区分公母以貔貅眼睛看去的方向为准。<br/><br/><strong><span style=\"color: rgb(135, 0, 25); font-size: 13px;\">【貔貅的摆放】</span></strong><br/>1、貔貅头45°角朝入户大门（即摆在财位上）或者朝窗外以及阳台外即可（窗及阳台需视野开阔）。<br/>2、貔貅的嘴边放一边水，水杯的高度不能高过貔貅的嘴。水用自来水即可，杯里的水要经常更换。<br/>3、貔貅摆放的高度不能高过人头，不能直接摆在地上<br/>4、不要头直冲正门即入户门，因为正门是门神或财神执掌的地方，貔貅无权过问。<br/>5、貔貅的头不能冲厕所门。<br/>6、不要冲镜子，因为镜子会产生光煞，貔貅忌讳。<br/>7、不要对着床，这样会对自己不利。<br/>8、开过光的貔貅要换地方摆放时请用干净的红布盖住貔貅的眼睛，移到新地方摆好后再把红布揭开即可。<br/>9、已经损坏的貔貅请用雨水擦干净后，用红布包起来收藏好，在做这些的时候请同时燃香。<br/><br/><strong><span style=\"color: rgb(135, 0, 25); font-size: 13px;\">【貔貅的忌禁】</span></strong><br/>1、不要头冲正门（从外面进来的门其他无所谓，但不要冲厕所），因为正门是门神或财神执掌的地方，貔貅无权过问。<br/>2、不要冲镜子，因为镜子会产生光煞，貔貅忌讳。<br/>3、不要对着床，这样会对自己不利。<br/><br/><strong><span style=\"color: rgb(135, 0, 25); font-size: 13px;\">【貔貅的供奉】</span></strong><br/>1、香炉里不能放沙子，泥土，要放江米（糯米），珍珠米，黑米。<br/>2、供奉果品中不能有梨，草莓。其他不忌，酒肉亦可供奉。<br/>3、女人有月经或者怀孕时严禁给貔貅上香，抚摩（貔貅忌光煞，血煞，胎煞）。<br/>4、不要经常打扫貔貅，每年只有四次打扫时间2.6/6.2/7.14/9.12都是以农历计算。<br/>5、不的随意搬动貔貅，不得抚摩貔貅嘴及头部，需要搬动时可先用红绸布包其头部再搬动。 如果你是以求偏财为主的行业，例如收入是佣金制的，奖金制的，而不是固定薪水的，那麼供奉貔貅将是很好的招财法宝。它会带你去有钱的地方，同时帮你把钱咬回来。<br/><br/></td></tr></tbody></table></td></tr><tr><td style=\"margin: 0px; padding: 0px;\"><img src=\"https://img.alicdn.com/imgextra/i1/8